import React from "react";
import { useState, useEffect } from "react";

function Codeforces() {
  const getUser = async () => {
    const respone = await fetch(
      `https://codeforces.com/api/user.rating?handle=Fefer_Ivan`
    );
    const data = await respone.json();
    console.log(data);
  };
  useEffect(() => {
    getUser();
  });

  return <></>;
}

export default Codeforces;
